import styled from "styled-components";

export const PageContainer = styled.div`
  background-color: #f8f8f8;
  min-height: 100%;
  display: flex;
  flex-direction: column;
`;

export const Title = styled.h3`
  position: relative;
  color: #00008b;
  font-size: 4rem;
  font-weight: bold;
  text-align: center;
  margin-bottom: 2rem;
  padding-top: 2rem;
`;
